   144â†’## Phase 2: MediaPipe Integration
   145â†’
   146â†’### 2.1 Create MediaPipe Hook (src/hooks/useFaceLandmarker.ts)
   147â†’```typescript
   148â†’import { useEffect, useRef, useState } from 'react';
   149â†’import { FaceLandmarker, FilesetResolver, DrawingUtils } from '@mediapipe/tasks-vision';
   150â†’
   151â†’interface Landmark {
   152â†’  x: number;
   153â†’  y: number;
   154â†’  z?: number;
   155â†’}
   156â†’
   157â†’export function useFaceLandmarker() {
   158â†’  const [landmarker, setLandmarker] = useState<FaceLandmarker | null>(null);
   159â†’  const [isLoading, setIsLoading] = useState(true);
   160â†’  const [error, setError] = useState<Error | null>(null);
   161â†’
   162â†’  useEffect(() => {
   163â†’    async function initLandmarker() {
   164â†’      try {
   165â†’        const vision = await FilesetResolver.forVisionTasks(
   166â†’          'https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@latest/wasm'
   167â†’        );
   168â†’
   169â†’        const faceLandmarker = await FaceLandmarker.createFromOptions(vision, {
   170â†’          baseOptions: {
   171â†’            modelAssetPath: 'https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task',
   172â†’            delegate: 'GPU'
   173â†’          },
   174â†’          runningMode: 'IMAGE',
   175â†’          numFaces: 1,
   176â†’          outputFacialTransformationMatrixes: true,
   177â†’          outputFaceBlendshapes: true
   178â†’        });
   179â†’
   180â†’        setLandmarker(faceLandmarker);
   181â†’        setIsLoading(false);
   182â†’      } catch (err) {
   183â†’        setError(err as Error);
   184â†’        setIsLoading(false);
   185â†’      }
   186â†’    }
   187â†’
   188â†’    initLandmarker();
   189â†’  }, []);
   190â†’
   191â†’  const detectLandmarks = async (imageElement: HTMLImageElement): Promise<Landmark[]> => {
   192â†’    if (!landmarker) throw new Error('Landmarker not initialized');
   193â†’
   194â†’    const result = landmarker.detect(imageElement);
   195â†’
   196â†’    if (result.faceLandmarks.length === 0) {
   197â†’      throw new Error('No face detected');
   198â†’    }
   199â†’
   200â†’    // Convert normalized coordinates to pixel coordinates
   201â†’    const landmarks = result.faceLandmarks[0].map(point => ({
   202â†’      x: point.x * imageElement.width,
   203â†’      y: point.y * imageElement.height,
   204â†’      z: point.z
   205â†’    }));
   206â†’
   207â†’    return landmarks;
   208â†’  };
   209â†’
   210â†’  return { detectLandmarks, isLoading, error };
   211â†’}
   212â†’```
