   294â†’### 3.1 The Core Editor (src/components/LandmarkEditor.tsx)
   295â†’```typescript
   296â†’'use client';
   297â†’
   298â†’import { useState, useRef, useCallback, useEffect } from 'react';
   299â†’import { TransformWrapper, TransformComponent } from 'react-zoom-pan-pinch';
   300â†’
   301â†’interface Point {
   302â†’  x: number;
   303â†’  y: number;
   304â†’  id: number;
   305â†’}
   306â†’
   307â†’interface LandmarkEditorProps {
   308â†’  imageUrl: string;
   309â†’  landmarks: Point[];
   310â†’  onLandmarksChange: (landmarks: Point[]) => void;
   311â†’  editableIndices?: number[];  // Which landmarks can be edited
   312â†’}
   313â†’
   314â†’export function LandmarkEditor({
   315â†’  imageUrl,
   316â†’  landmarks,
   317â†’  onLandmarksChange,
   318â†’  editableIndices
   319â†’}: LandmarkEditorProps) {
   320â†’  const [selectedPoint, setSelectedPoint] = useState<number | null>(null);
   321â†’  const [isDragging, setIsDragging] = useState(false);
   322â†’  const containerRef = useRef<HTMLDivElement>(null);
   323â†’  const imageRef = useRef<HTMLImageElement>(null);
   324â†’
   325â†’  const isEditable = (index: number) => {
   326â†’    if (!editableIndices) return true;
   327â†’    return editableIndices.includes(index);
   328â†’  };
   329â†’
   330â†’  const handlePointMouseDown = (index: number, e: React.MouseEvent) => {
   331â†’    if (!isEditable(index)) return;
   332â†’    e.stopPropagation();
   333â†’    setSelectedPoint(index);
   334â†’    setIsDragging(true);
   335â†’  };
   336â†’
   337â†’  const handleMouseMove = useCallback((e: React.MouseEvent) => {
   338â†’    if (!isDragging || selectedPoint === null || !containerRef.current) return;
   339â†’
   340â†’    const rect = containerRef.current.getBoundingClientRect();
   341â†’    const x = e.clientX - rect.left;
   342â†’    const y = e.clientY - rect.top;
   343â†’
   344â†’    const newLandmarks = [...landmarks];
   345â†’    newLandmarks[selectedPoint] = { ...newLandmarks[selectedPoint], x, y };
   346â†’    onLandmarksChange(newLandmarks);
   347â†’  }, [isDragging, selectedPoint, landmarks, onLandmarksChange]);
   348â†’
   349â†’  const handleMouseUp = useCallback(() => {
   350â†’    setIsDragging(false);
   351â†’    setSelectedPoint(null);
   352â†’  }, []);
   353â†’
   354â†’  // Key landmark groups for visualization
   355â†’  const landmarkGroups = {
   356â†’    eyes: [33, 133, 362, 263, 468, 473],
   357â†’    nose: [4, 6, 2, 129, 358],
   358â†’    lips: [13, 14, 61, 291],
   359â†’    jaw: [152, 172, 397, 234, 454]
