   476â†’## Phase 4: Facial Calculations
   477â†’
   478â†’### 4.1 Measurement Functions (src/lib/calculations.ts)
   479â†’```typescript
   480â†’interface Point {
   481â†’  x: number;
   482â†’  y: number;
   483â†’}
   484â†’
   485â†’// Basic geometry
   486â†’export function distance(p1: Point, p2: Point): number {
   487â†’  return Math.sqrt(Math.pow(p2.x - p1.x, 2) + Math.pow(p2.y - p1.y, 2));
   488â†’}
   489â†’
   490â†’export function angle(p1: Point, vertex: Point, p2: Point): number {
   491â†’  const a = distance(vertex, p1);
   492â†’  const b = distance(vertex, p2);
   493â†’  const c = distance(p1, p2);
   494â†’  const radians = Math.acos((a * a + b * b - c * c) / (2 * a * b));
   495â†’  return radians * (180 / Math.PI);  // Convert to degrees
   496â†’}
   497â†’
   498â†’export function midpoint(p1: Point, p2: Point): Point {
   499â†’  return {
   500â†’    x: (p1.x + p2.x) / 2,
   501â†’    y: (p1.y + p2.y) / 2
   502â†’  };
   503â†’}
   504â†’
   505â†’// FACIAL MEASUREMENTS
   506â†’
   507â†’export function calculateFWHR(landmarks: Point[]): number {
   508â†’  // Face Width-to-Height Ratio
   509â†’  // Width: bizygomatic (cheekbone to cheekbone)
   510â†’  // Height: upper face height (eyebrow to upper lip)
   511â†’
   512â†’  const leftCheekbone = landmarks[234];
   513â†’  const rightCheekbone = landmarks[454];
   514â†’  const eyebrowCenter = landmarks[10];
   515â†’  const upperLip = landmarks[13];
   516â†’
   517â†’  const width = distance(leftCheekbone, rightCheekbone);
   518â†’  const height = distance(eyebrowCenter, upperLip);
   519â†’
   520â†’  return width / height;
   521â†’}
   522â†’
   523â†’export function calculateFacialThirds(landmarks: Point[]): {
   524â†’  upper: number;
   525â†’  middle: number;
   526â†’  lower: number;
   527â†’  isBalanced: boolean;
   528â†’} {
   529â†’  // Ideal: Each third should be ~33%
   530â†’  const hairline = landmarks[10];  // approximation
   531â†’  const glabella = landmarks[9];   // between eyebrows
   532â†’  const subnasale = landmarks[2];  // base of nose
   533â†’  const menton = landmarks[152];   // chin
   534â†’
   535â†’  const upperThird = distance(hairline, glabella);
   536â†’  const middleThird = distance(glabella, subnasale);
   537â†’  const lowerThird = distance(subnasale, menton);
   538â†’  const total = upperThird + middleThird + lowerThird;
   539â†’
   540â†’  const upper = (upperThird / total) * 100;
   541â†’  const middle = (middleThird / total) * 100;
   542â†’  const lower = (lowerThird / total) * 100;
   543â†’
   544â†’  // Balanced if each is within 5% of 33.33%
   545â†’  const isBalanced = [upper, middle, lower].every(
   546â†’    v => Math.abs(v - 33.33) < 5
   547â†’  );
   548â†’
   549â†’  return { upper, middle, lower, isBalanced };
   550â†’}
   551â†’
   552â†’export function calculateCanthalTilt(landmarks: Point[]): number {
   553â†’  // Positive = upward tilt (considered attractive)
   554â†’  // Negative = downward tilt
   555â†’
   556â†’  const leftEyeOuter = landmarks[33];
   557â†’  const leftEyeInner = landmarks[133];
   558â†’  const rightEyeInner = landmarks[362];
   559â†’  const rightEyeOuter = landmarks[263];
   560â†’
   561â†’  // Calculate angle from horizontal for each eye
   562â†’  const leftAngle = Math.atan2(
   563â†’    leftEyeInner.y - leftEyeOuter.y,
   564â†’    leftEyeInner.x - leftEyeOuter.x
   565â†’  ) * (180 / Math.PI);
   566â†’
   567â†’  const rightAngle = Math.atan2(
   568â†’    rightEyeOuter.y - rightEyeInner.y,
   569â†’    rightEyeOuter.x - rightEyeInner.x
   570â†’  ) * (180 / Math.PI);
   571â†’
   572â†’  return (leftAngle + rightAngle) / 2;
   573â†’}
   574â†’
   575â†’export function calculateSymmetry(landmarks: Point[]): number {
   576â†’  // Compare left vs right side of face
   577â†’  // 100 = perfect symmetry
   578â†’
   579â†’  const pairs = [
   580â†’    [33, 263],   // eye outer corners
   581â†’    [133, 362],  // eye inner corners
   582â†’    [70, 300],   // eyebrow peaks
   583â†’    [234, 454],  // cheekbones
   584â†’    [172, 397],  // jaw angles
   585â†’    [129, 358],  // nose ala
   586â†’    [61, 291],   // lip corners
   587â†’  ];
   588â†’
   589â†’  // Get face center (nose tip as reference)
   590â†’  const center = landmarks[4];
   591â†’
   592â†’  let totalDifference = 0;
   593â†’
   594â†’  pairs.forEach(([leftIdx, rightIdx]) => {
   595â†’    const left = landmarks[leftIdx];
   596â†’    const right = landmarks[rightIdx];
   597â†’
   598â†’    const leftDist = distance(center, left);
   599â†’    const rightDist = distance(center, right);
   600â†’
   601â†’    const diff = Math.abs(leftDist - rightDist) / ((leftDist + rightDist) / 2);
   602â†’    totalDifference += diff;
   603â†’  });
   604â†’
   605â†’  const avgDifference = totalDifference / pairs.length;
   606â†’  return Math.max(0, 100 - (avgDifference * 100));
   607â†’}
   608â†’
   609â†’export function calculateGoldenRatio(landmarks: Point[]): number {
   610â†’  // Phi (Ï†) = 1.618
   611â†’  // Compare face proportions to golden ratio
   612â†’
   613â†’  const phi = 1.618;
   614â†’
   615â†’  const faceWidth = distance(landmarks[234], landmarks[454]);
   616â†’  const faceHeight = distance(landmarks[10], landmarks[152]);
   617â†’  const ratio = faceHeight / faceWidth;
   618â†’
   619â†’  // How close to phi (percentage)
   620â†’  const deviation = Math.abs(ratio - phi) / phi;
   621â†’  return Math.max(0, 100 - (deviation * 100));
   622â†’}
   623â†’
   624â†’// SIDE PROFILE MEASUREMENTS
   625â†’
   626â†’export function calculateNasofrontalAngle(sideLandmarks: Point[]): number {
   627â†’  // Angle between forehead and nose bridge
   628â†’  // Ideal: 115-130 degrees
   629â†’
   630â†’  const glabella = sideLandmarks[16];
   631â†’  const nasion = sideLandmarks[17];
   632â†’  const pronasale = sideLandmarks[30];
   633â†’
   634â†’  return angle(glabella, nasion, pronasale);
   635â†’}
   636â†’
   637â†’export function calculateNasolabialAngle(sideLandmarks: Point[]): number {
   638â†’  // Angle between nose and upper lip
   639â†’  // Ideal: 90-120 degrees (varies by gender)
   640â†’  // Male: 90-95, Female: 95-110
   641â†’
   642â†’  const columella = sideLandmarks[32];  // between nostrils
   643â†’  const subnasale = sideLandmarks[35];
   644â†’  const upperLip = sideLandmarks[42];
   645â†’
   646â†’  return angle(columella, subnasale, upperLip);
   647â†’}
   648â†’
   649â†’export function calculateGonialAngle(sideLandmarks: Point[]): number {
   650â†’  // Jaw angle
   651â†’  // Ideal: 120-130 degrees
   652â†’
   653â†’  const tragus = sideLandmarks[95];
   654â†’  const gonion = sideLandmarks[85];
   655â†’  const menton = sideLandmarks[70];
   656â†’
   657â†’  return angle(tragus, gonion, menton);
   658â†’}
   659â†’
   660â†’export function calculateChinProjection(sideLandmarks: Point[]): {
   661â†’  value: number;
   662â†’  assessment: string;
   663â†’} {
   664â†’  // Distance from subnasale vertical line to pogonion
   665â†’
   666â†’  const subnasale = sideLandmarks[35];
   667â†’  const pogonion = sideLandmarks[65];
   668â†’
   669â†’  // Positive = prominent chin, Negative = recessed
   670â†’  const projection = pogonion.x - subnasale.x;
   671â†’
   672â†’  let assessment = 'Normal';
   673â†’  if (projection > 10) assessment = 'Prominent';
   674â†’  if (projection < -5) assessment = 'Recessed';
   675â†’
   676â†’  return { value: projection, assessment };
   677â†’}
   678â†’
   679â†’// COMPREHENSIVE ANALYSIS
   680â†’
   681â†’export function analyzeFullFace(
   682â†’  frontLandmarks: Point[],
   683â†’  sideLandmarks?: Point[]
   684â†’): FaceAnalysis {
   685â†’  const analysis: FaceAnalysis = {
   686â†’    // Front face measurements
   687â†’    fwhr: calculateFWHR(frontLandmarks),
   688â†’    facialThirds: calculateFacialThirds(frontLandmarks),
   689â†’    canthalTilt: calculateCanthalTilt(frontLandmarks),
   690â†’    symmetry: calculateSymmetry(frontLandmarks),
   691â†’    goldenRatioScore: calculateGoldenRatio(frontLandmarks),
   692â†’
   693â†’    // Side profile measurements (if available)
   694â†’    sideProfile: sideLandmarks ? {
   695â†’      nasofrontalAngle: calculateNasofrontalAngle(sideLandmarks),
   696â†’      nasolabialAngle: calculateNasolabialAngle(sideLandmarks),
   697â†’      gonialAngle: calculateGonialAngle(sideLandmarks),
   698â†’      chinProjection: calculateChinProjection(sideLandmarks)
   699â†’    } : null
   700â†’  };
   701â†’
   702â†’  return analysis;
   703â†’}
   704â†’
   705â†’interface FaceAnalysis {
   706â†’  fwhr: number;
   707â†’  facialThirds: { upper: number; middle: number; lower: number; isBalanced: boolean };
   708â†’  canthalTilt: number;
   709â†’  symmetry: number;
   710â†’  goldenRatioScore: number;
