generator client {
  provider = "prisma-client-js"
}

datasource db {
  provider = "postgresql"
  url      = env("DATABASE_URL")
}

model User {
  id            String    @id @default(cuid())
  email         String    @unique
  name          String?
  image         String?
  createdAt     DateTime  @default(now())
  faces         Face[]
  subscription  Subscription?
}

model Face {
  id              String    @id @default(cuid())
  userId          String
  user            User      @relation(fields: [userId], references: [id])

  // Images
  frontUrl        String?
  sideUrl         String?

  // Raw landmarks from MediaPipe
  frontLandmarks  Json?     // Array of {x, y, z?} - 478 points
  sideLandmarks   Json?     // Array of {x, y} - 106 points

  // User-adjusted landmarks (after manual correction)
  adjustedFrontLandmarks  Json?
  adjustedSideLandmarks   Json?

  // Calculated measurements
  measurements    Json?     // All facial ratios and angles

  // Metadata
  createdAt       DateTime  @default(now())
  updatedAt       DateTime  @updatedAt
  status          FaceStatus @default(PENDING)
}

enum FaceStatus {
  PENDING
  FRONT_UPLOADED
  FRONT_ANALYZED
  SIDE_UPLOADED
  SIDE_ANALYZED
  COMPLETE
}

model Subscription {
  id        String   @id @default(cuid())
  userId    String   @unique
  user      User     @relation(fields: [userId], references: [id])
  plan      Plan     @default(FREE)
  expiresAt DateTime?
}

enum Plan {
  FREE
  PRO
  PREMIUM
}
